import './scss/FileName.scss';

function App() {
  let x = 5;
  let y = 2;
  let z = x + y;

  document.getElementById("demo").innerHTML = z.toString();

  return (
    <div className="App">
      <header className='header'>
        <a href='/' className='header_logo'></a>
      </header>
    </div>
  );
}

export default App;
